import React from "react";
import { Router, Route, Link, withRouter } from "react-router-dom";

function StudentListItem({ value, item }) {
  return (
    <option key={value} value={value}>
      <Link to={`/${item}`}>{item}</Link>
      
    </option>
  );
}

export default StudentListItem;
